import React from 'react'

// const Register = props => (<h1>I am Register</h1>)

class Register extends React.Component {
	state = {
		name: '',
		email: '',
		password: '',
		confirmPassword: '',
		error: {}
	}

	changeHandler = event => {
		this.setState({
			[event.target.name]: event.target.value
		})
	}

	submitHandler = event => {
		event.preventDefault()
	}
}
export default Register
